import React from "react";
import Drawer from '@material-ui/core/Drawer';
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom';
function Menu()
{
    const [state, setState] = React.useState({
      top: false,
      left: false,
      bottom: false,
      right: false,
    });

    const toggleDrawer = (anchor, open) => (event) => {
      if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
        return;
      }

      setState({ ...state, [anchor]: open });
    };
  return(

    <div>
    <React.Fragment key={'left'}>
      <Button onClick={toggleDrawer('left', true)}><svg xmlns="http://www.w3.org/2000/svg" x="0px" y="0px"
width="64" height="64"
viewBox="0 0 128 128"
style=" fill:#000000;"><path fill="#fff" d="M64 14A50 50 0 1 0 64 114A50 50 0 1 0 64 14Z"></path><path fill="#444b54" d="M64,117c-29.2,0-53-23.8-53-53s23.8-53,53-53s53,23.8,53,53S93.2,117,64,117z M64,17c-25.9,0-47,21.1-47,47s21.1,47,47,47s47-21.1,47-47S89.9,17,64,17z"></path><path fill="#444b54" d="M86.5 52h-45c-1.7 0-3-1.3-3-3s1.3-3 3-3h45c1.7 0 3 1.3 3 3S88.2 52 86.5 52zM86.5 67h-45c-1.7 0-3-1.3-3-3s1.3-3 3-3h45c1.7 0 3 1.3 3 3S88.2 67 86.5 67z"></path><g><path fill="#444b54" d="M86.5,82h-45c-1.7,0-3-1.3-3-3s1.3-3,3-3h45c1.7,0,3,1.3,3,3S88.2,82,86.5,82z"></path></g></svg></Button>
      <Drawer anchor={'left'} open={state['left']} onClose={toggleDrawer('left', false)} >

          <Button> The Data Anecdotes </Button>
          <Link to="/"><Button>  Home </Button></Link>
          <Link to="/Stories"> <Button> Stories </Button></Link>
          <Link to="/Search"><Button> Search </Button></Link>
          <Link to="/ContactUs"><Button> Contact Us</Button></Link>

      </Drawer>
    </React.Fragment>
    </div>
  )
}
export default Menu;
